  "description": {
    "nb": "Datasettet viser om det er lett eller vanskelig å grave i bunnen. Gravbarhet er basert på sedimentfordeling, og angir både hvor enkelt det er å grave i bunnen og den forventede stabiliteten til det utgravde området. For eksempel vil sandige sedimenter gjerne kollapse fortere etter utgravning enn hva mer finkornig materiale vil."
  },
