  "title": {
    "nb": "Marine biotoper"
  },
  "description": {
    "nb": "Metadata beskriver et sett av data med biotoper i norske havområder. Biotoper er områder med særegne bunndyrsamfunn og likt fysisk miljø. Hvert biotop har oftest en unik sammensetning av arter. Hvilke arter dette er, bestemmes av miljøforholdene i området. Klassifikasjonen er basert på video- og miljøvariabelanalyse."
