  "description": {
    "nb": "NGU har utarbeidet en database for geologisk arv. Databasen inneholder landsdekkende data over lokaliteter med interessant geologi, sammen med informasjon om sårbarhet og et eventuelt behov for vern. En kartapplikasjon er allerede utviklet. Når en lokalitet eller område aktiveres i kartapplikasjonen med info-knappen får man tilgang til et faktaark som beskriver hvorfor denne er interessant, og kanskje verd å ta vare på for ettertiden. (Datasettet er tidligere omtalt som geologisk naturarv)."
