  "title": {
    "nb": "Nasjonal database for grunnundersøkelser (NADAG)"
  },
  "description": {
    "nb": "NGU har utviklet nasjonal database for grunnundersøkelser (NADAG) med tilhørende karttjenester og muligheter for å laste opp data, i første omgang for geotekniske undersøkelser. Prosjektet for utvikling av NADAG er et samarbeid mellom NGU og etatene Statens vegvesen, Bane NOR, og Norges vassdrags- og energidirektorat, og konsulentene Norkart og Trimble. Punktene i kartet representerer geotekniske borehull (GB), hvor metadata vises (f.eks. boretype, oppdragsfirma, oppdragsgiver, stedfestelse (posisjon), boret dybde (evt. dyp til fjell), rapportnr.). For noen punkter vil mer informasjon være tilgjengelig (f.eks. lenke til rapport og evt. til rådata, boreprofil og måleresultater). NADAG-modellen er basert på en datastruktur beskrevet i SOSI-standardene for Geovitenskapelige undersøkelser og Geotekniske undersøkelser. NADAG er foreslått som DOK-leveranse. Visningstjenesten til NADAG har to innsynsløsninger. I ”enkelt innsyn” har man tilgang til noen få standardvalg. Ønsker man flere muligheter for innsyn, kartlag, filter o.l. går man til ”avansert innsyn” med flere standardvisninger, mulighet til å velge mellom ulike kartlag/temalag, samt utføre enkelte søk og filtreringer. NADAG er landsdekkende, og vil gradvis fylles med mer data etter som dataeiere systematiserer og leverer sine data. Man kan i hovedsak levere data til NADAG på to måter: gjennom verktøyet GeoSuite toolbox (fullstendige datasett), eller gjennom NADAGs opplastingsportal (Excel-skjema utfylt iht. mal). Alle data som ligger i NADAG er fritt tilgjengelig for alle, og lastes ned vederlagsfritt. Det vil være varierende mengde informasjon tilhørende hvert datapunkt, noe som vil avhenge blant annet av formatet data er overlevert på, og dataeiers vilje til å offentliggjøre data utover kun å vise metadata. Løsning for nedlasting av dataene på ulike format er under utvikling. NADAG og bidragsytere er ikke ansvarlige for den enkeltes bruk av datasettene. Datasettene og rapportene ble laget for bestemte formål/prosjekt. Den som benytter data for nye formål/prosjekt må gjøre egne og selvstendige vurderinger av dataenes kvalitet, egnethet og gyldighet. Ved bruk av data skal det refereres til rapport/dataeier. Datasettet er gjort tilgjengelig under Norsk lisens for offentlige data (NLOD). Ved å starte NADAG nettjeneste godtar du disse vilkårene for bruk."
  },
