  },
  "description": {
    "nb": "Datasettet viser en inndeling av havområdene i ulike marine landskap, definert som større geografiske områder med enhetlig visuelt preg. Marin landskapskartlegging går ut på å beskrive de store trekkene i topografien på havbunnen. Klassifiseringen som er gjort her, bygger på Naturtyper i Norge. Klassifiseringen er basert på batymetri med 50 meters oppløsning."
  },
