  "title": {
    "nb": "Bunnreflektivitet"
  },
  "description": {
    "nb": "Datasettet viser reflektivitetstyrke fra sjøbunnen. Reflektivitetsstyrke sier noe om sjøbunnens akustiske respons, noe som kan gi indikasjoner om sjøbunnenes beskaffenhet. Generelt vil en sterk tilbakerefleksjon indikere hard bunn, mens svakere refleksjon indikererer bløterer bunn. Sjøbunnens beskaffenhet tolket ut fra reflektivitet gir indikasjoner på type sediment og dermed også opplysninger om sedimentasjonsforhold og prosesser på bunnen."
  },
