  "title": {
    "nb": "Ankringsforhold"
  },
  "description": {
    "nb": "Datasettet viser ankringsforhold på havbunnen i utvalgte kystområder tolket ut fra bunntype og dybde. Det skilles mellom ankring og forankring. I et område med dårlige ankringsforhold (hard bunn) kan det likevel være mulig å forankre med bolter i fjellet grunnere enn 30 m. Detaljnivået på datasettet tilsier bruk i kartmålestokk 1:10 000 - 1:50 000."
  },
  "descriptionFormatted": {
    "nb": "Datasettet viser ankringsforhold på havbunnen i utvalgte kystområder tolket ut fra bunntype og dybde. Det skilles mellom ankring og forankring. I et område med dårlige ankringsforhold (hard bunn) kan det likevel være mulig å forankre med bolter i fjellet grunnere enn 30 m. Detaljnivået på datasettet tilsier bruk i kartmålestokk 1:10 000 - 1:50 000."
